import { Col, Container, Row } from "react-bootstrap";

import "./BookHomeUpdata.css";
const BookHomeUpdata = ({ newBook }) => {
  return (
    <>
      <Container>
        <Row>
          {newBook.map((item, i) => {
            return (
              <>
                <Col xl={5}>title</Col>
                <Col xl={3}>category</Col>
                <Col xl={2}>chapter</Col>
                <Col xl={2}>time</Col>
              </>
            );
          })}
        </Row>
      </Container>
    </>
  );
};

export default BookHomeUpdata;
